import { Header } from './Header';


function App() {

    // const CatImg =
    fetch('https://api.thecatapi.com/v1/images/search')
        .then(function(res) {
            console.log(res)
            return res.json();
        })
        .then((data) => {
            console.log(data);
            console.log(data[0].url)
        })

    // .then((data)=>console.log(data))
    return (
        <Header />
    )
}
export default App;
